import logo from './logo.svg';
import './App.css';
import axios from "axios";
import React, { useState } from 'react';

const [vehicles, setVehicles] = useState('');

const getVehicles = async () => {
  const res = await axios("/vehicles");
  const data = res.json();
  console.log(data);
  setVehicles(data)
}

function App() {
  getVehicles();
  return (
    <div className="App">
      <header className="App-header">
        sss
        {vehicles}
      </header>
    </div>
  );
}

export default App;
